import Projects from "./fieldsDS/Projects";
import Education from "./fieldsDS/Education";

const RightConstantDS = () => {
  return (
    <div>
      <About />
      <Education />
      <Experience />
      <Projects />
    </div>
  );
};

export default RightCOnstantDS;
